import { currentUser } from "@clerk/nextjs/server"
import { db } from "./db";


export const checkUser =()=>{
    const user = currentUser();

    if(!user){
        return null
    }

    const loggedInUser = await db.user.findUnique({
        where:{
            clerkUserId: user.id
        },
    });
    if (loggedInUser){
        return loggedInUser
    }
}

